"original": |2-
           The Client MAY supply and the Printer MUST support this
           attribute.  It is a set of attribute names and/or attribute
           group names in whose values the requester is interested.  If
           the Client omits this attribute, the Printer MUST respond as if
           this attribute had been supplied with a value of 'all'.
"fixed": |-
  - The Client MAY supply and the Printer MUST support this attribute.  It is a set of attribute names and/or attribute group names in whose values the requester is interested.  If the Client omits this attribute, the Printer MUST respond as if this attribute had been supplied with a value of 'all'.
"ko": |-
  - 클라이언트는 이 속성을 제공할 수 있고 프린터는 이 속성을 지원해야 합니다. 이는 요청자가 관심을 갖고 있는 값의 속성 이름 및/또는 속성 그룹 이름의 집합입니다. 클라이언트가 이 속성을 생략하면 프린터는 이 속성이 'all' 값으로 제공된 것처럼 응답해야 합니다.
